@media screen and (min-width:992px) {
    .projects-block {
        display: grid;
        grid-template-columns: repeat(3, 1fr);
        column-gap: 30px;
    }
    .project {
        width: 100%;
    }
    .img-text h1 {
        font-size: 1.2rem;
    }
    .img-text h3 {
        font-size: 0.8rem;
    }
}

/* --------------- team section------------------- */

#team {
    max-width: 100vw;
    background: url('./img/background.jpeg');
    background-position: top;
    background-attachment: fixed;
    background-size: cover;
    /*whole image shows*/
    background-repeat: no-repeat;
    margin: 0 auto;
}

.team-wrapper {
    /* background: var(--mainGrey); */
    max-width: 100vw;
    padding: 20px;
    margin: 0 auto;
}

.team-title {
    font-size: 40px;
    text-align: center;
    /* font-style: italic; */
    text-transform: uppercase;
    color: var(--mainBlack);
}

.front-line, .back-line {
    margin: 30px auto;
    width: 300px;
    border: 1px solid var(--mainGrey);
}

.member {
    background: rgb(255, 203, 166, 0.4);
    padding: 20px;
    position: relative;
    margin: 40px 10px;
    display: flex;
    flex-direction: column;
}

.member img {
    max-width: 100%;
    max-height: 100%;
}

.member-info {
    display: flex;
    flex-direction: column;
    justify-content: flex-start;
}

.member button {
    bottom: 0;
    width: 150px;
    color: var(--mainBlack);
    background: var(--mainLight);
}

.member button:hover {
    color: var(--mainLight);
    background: var(--mainColor);
}

.member-info h1, h3 {
    padding: 5px 0;
}

@media screen and (min-width:576px) {
    .team-block {
        display: grid;
        grid-template-columns: repeat(2, 1fr);
    }
}

@media screen and (min-width:768px) {
    .team-block {
        display: grid;
        grid-template-columns: repeat(3, 1fr);
        margin: 0 6%;
        column-gap: 1%;
    }
}

/* ---------------end of team section------------------- */

