footer {
    background: var(--mainGrey);
    color: var(--mainWhite);
    display: flex;
    flex-wrap: wrap;
    justify-content: space-around;
    align-items: baseline;
}

.footer h3 {
    font-size: 15px;
}

.footer-icons {
    font-size: 20px;
}

.footer-icons .fa {
    transition: transform 0.4s;
    padding: 0 5px;
    color: white;
}

.footer-icons .fa:hover {
    transform: translateY(-10px);
}

