    background: var(--mainColor);
    padding: 40px 0;
    margin: 0 auto;
}

#contact-form .title {
    display: flex;
    flex-direction: row;
    justify-content: space-around;
    color: var(--mainBlack);
}

#contact-form .title button {
    background: var(--mainLight);
    color: var(--mainBlack);
}

